import React, { Component } from "react";
import Avatar from "./Avatar";

function Card(props) {
  return (
    <div className="card">
      <div className="top">
        <h2 className="name">{props.name}</h2>
        <Avatar />
      </div>
      <div className="bottom">
        <p className="info">{props.tell}</p>
        <p className="info">{props.email}</p>
      </div>
    </div>
  );
}

export default Card;
